import logo from './logo.svg';
import './App.css';

let year = "February";
let today = new Date();
let currDay = String(today.getDay()-1)
let currMonth = String(today.getMonth()+1);

function App() {
  return (
    <div className="bg">
      <div className="Calendar">
        <h1 className="Year">
          {`${currMonth}/${currDay}`}
        </h1>
      </div>
    </div>
  );
}

export default App;
